import style from './Form.module.css'

import { useState } from 'react'

const Form = () =>{

    const [ userData, setUserData] = useState({
        username:'',
        password:'',
    })

    return (
        <form action="">

            <label>Username:<input type="text" id="Name" name="Name" /></label>
            
            <label>
                Password: <input type="text" id="Password" name="Password" />
            </label>

            <button>LOGIN</button>

        </form>
    )
}

export default Form
